f0\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-5689416436118699688d0fd0b0e-0d65-45b4-a9e4-003d7c4cc040\\\" style\\u003d\\\"font-size:24px\\\"\\u003ePay \\u0026amp; Hiring Trends \\u003cstrong\\u003e📈\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996883ed8ee33-5da6-4310-bf17-063797a9c3d4\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eThe market is tightening. \\u003c/strong\\u003eCompanies aren\\u0026#39;t necessarily lowering pay bands, but what we\\u0026#39;re seeing is companies are not having to go \\u0026#39;out of band\\u0026#39; in their offers. Around a year ago it was common for companies to have to get special approval for nearly every offer because the market was so hot. We\\u0026#39;re seeing far fewer out of band offers now driving the median lower.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996881b75a106-3f95-4a07-84d5-5e6af1adf2ba\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eOn hiring\\u003c/strong\\u003e, our \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/9434cfeb-c356-4396-afcd-b01d52960616/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/9434cfeb-c356-4396-afcd-b01d52960616/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw193R09CwnHDF2WiiFcKGwa\\\"\\u003enegotiation coaches\\u003c/a\\u003e are seeing some interesting patterns emerge:\\u003c/p\\u003e\\r\\n\\r\\n\\u003col id\\u003d\\\"m_-5689416436118699688467972c7-e728-4d0a-9b25-776b936e0918\\\" start\\u003d\\\"1\\\" type\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cli style\\u003d\\\"font-size:16px\\\"\\u003eContinued hiring among FAANG. \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/b844e671-745d-4d67-b194-8ae33feb034c/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/b844e671-745d-4d67-b194-8ae33feb034c/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw1TuOtiSL1HXwE2BQN9vYjm\\\"\\u003eApple\\u003c/a\\u003e, \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/9e74f2e6-3320-4850-a7a6-0666f9004882/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/9e74f2e6-3320-4850-a7a6-0666f9004882/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw3iswfwQkZLgfJnQjNGsoe9\\\"\\u003eGoogle\\u003c/a\\u003e, and \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/2d336149-0c2a-45f0-a333-8c2a9921f2e7/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/2d336149-0c2a-45f0-a333-8c2a9921f2e7/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw1vBgKDRzvyoxOHhLFvwMiQ\\\"\\u003eMicrosoft\\u003c/a\\u003e are three big names we’ve seen a lot of movement with. \\u003c/li\\u003e\\r\\n\\u003c/ol\\u003e\\r\\n\\r\\n\\u003col id\\u003d\\\"m_-568941643611869968874cc2046-92eb-443c-bb12-ce658ae75765\\\" start\\u003d\\\"2\\\" type\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cli style\\u003d\\\"font-size:16px\\\"\\u003e\\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/790d7c89-9e39-42d5-a428-d728d9571518/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/790d7c89-9e39-42d5-a428-d728d9571518/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw1S3J24ojdkH00_qg5707qX\\\"\\u003eOpenAI\\u003c/a\\u003e has been a big topic for us this month, with a lot of hiring movement going their way. While they don’t negotiate offers, it’s still useful to know how it works. Check out our blog post on the their compensation process below!\\u003c/li\\u003e\\r\\n\\u003c/ol\\u003e\\r\\n\\r\\n\\u003col id\\u003d\\\"m_-568941643611869968866f6cec3-5cbf-40aa-a803-502b25cc30f7\\\" start\\u003d\\\"3\\\" type\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cli style\\u003d\\\"font-size:16px\\\"\\u003eRetention offers for AI Engineers are very strong. We’ve seen a lot of companies do what they can to keep their AI engineers with retention packages nearing in the 7 digits. \\u003c/li\\u003e\\r\\n\\u003c/ol\\u003e\\r\\n\\r\\n\\u003col id\\u003d\\\"m_-56894164361186996886dc8ed3f-4b5a-4a4f-9e0a-93faf7595b56\\\" start\\u003d\\\"4\\\" type\\u003d\\\"1\\\"\\u003e\\r\\n\\u003cli style\\u003d\\\"font-size:16px\\\"\\u003eThe salary climate is very conservative right now. Many offers are going through much more rigorous approval processes with more involvement from HR, compensation, and hiring teams. Want to know how to handle these situations? Be sure to check out our \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/053b0c09-f7b3-4e67-b04d-7f719a750b94/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/053b0c09-f7b3-4e67-b04d-7f719a750b94/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw0qzksv0oQ-J0pwNRg_5Izn\\\"\\u003enegotiation coaching\\u003c/a\\u003e. Our coaches have helped tons of clients navigate this murky climate and secure increases of upwards of $100k from original offers!\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/li\\u003e\\r\\n\\u003c/ol\\u003e\\r\\n\\r\\n\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996880801f120-49a1-4413-b364-5e638cac7e8d\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 style\\u003d\\\"font-size:24px\\\"\\u003e\\u003cstrong\\u003eOpenAI – How Their Compensation Works \\u003c/strong\\u003e💻\\u003c/h2\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003eWe’ve gotten a ton of questions about how OpenAI is able to pay their employees \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/f3ecf608-b702-4149-97f5-dbdd97ebaebc/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/f3ecf608-b702-4149-97f5-dbdd97ebaebc/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw2REel15qa5at9R1BZQdtA3\\\"\\u003eso highly\\u003c/a\\u003e. And after some deep diving and research, we’ve found some answers!\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003eOpenAI’s compensation packages include Profit Participation Units (PPUs) in lieu of traditional stock based compensation. The basis for PPUs are Profit Interest Units (PIUs). In simplistic terms, with a PIU you are entitled to a percentage of the profits based on however many PIUs exist. As an example, if you own 1 PIU and there exist a total of 100 PIU’s, you are entitled to 1% of the profits of the company. OpenAI has also offered liquidity for the PPUs its issued to employees via tender offers such as the one earlier this year in January.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003eRead all about OpenAI’s offer structure, PPUs, and the associated constraints on our more detailed blog post \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/3f0a5ac2-2cf3-45cc-a11b-77c5940234f5/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/3f0a5ac2-2cf3-45cc-a11b-77c5940234f5/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw12kpHXluOoT2tUqr5RPVJU\\\"\\u003ehere\\u003c/a\\u003e.\\u003c/p\\u003e\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eDo you help plan compensation?\\u003c/strong\\u003e Reply to this email for access to our new comp benchmarking tools.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-56894164361186996889987b04d-d37b-40cc-840b-84501a857b44\\\" style\\u003d\\\"font-size:24px\\\"\\u003eGrowing Demand for Hardware Engineers 🤖\\u003c/h2\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688e03862f4-4f7c-4fa7-a3a6-6c79eca48b1d\\\" style\\u003d\\\"font-size:16px\\\"\\u003eDemand for hardware engineers is on the rise. Numerous companies have mentioned that they’re investing in competitive recruiting strategies for hardware engineering talent, especially with the rise in hardware level AI and GPU based applications.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688f6089449-e0b1-401e-ad3d-3cb62e5eb7e0\\\" style\\u003d\\\"font-size:16px\\\"\\u003eThere is an overall deficit in hardware engineer talent. Over time, they’ve become harder and harder to find (ASIC, FFPGA, Processors, SoC, etc). Many of the current professionals are part of an older population that’s starting to retire, with not enough graduates to fill that gap. While compensation has generally been lower for hardware engineers as opposed to their software engineer counterparts, this new influx of demand may change that. It’s still early, but compensation is bound to increase and there are nascent signs of the market starting to heat up.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996883b10bd48-d5c4-415b-b2b8-091f816036f4\\\" style\\u003d\\\"font-size:16px\\\"\\u003eWe’re keeping our eyes peeled and will report back on any trends. Help us collect more data by spreading the word! You can contribute \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/821b79a9-018c-4b7e-bec5-0ca399e992d2/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/821b79a9-018c-4b7e-bec5-0ca399e992d2/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw3qT3X2KWbA362UFTto_zzU\\\"\\u003ehere\\u003c/a\\u003e.\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688b1b25ff6-4344-4148-9c8c-32972aa42a7f\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-5689416436118699688fe1938ca-73be-4995-8bf4-97fd6fd834da\\\" style\\u003d\\\"font-size:24px\\\"\\u003e\\u003cstrong\\u003eTrimodal Nature of Internship Salaries 💰\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\r\\n\\u003cstrong\\u003e\\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/f3e064e1-c738-479d-b49c-012d5542d23d/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/f3e064e1-c738-479d-b49c-012d5542d23d/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw2uDwCMjB332R2BI-wUIE1_\\\"\\u003e\\u003cimg alt\\u003d\\\"The Trimodal Nature of Software Internship Salaries\\\" src\\u003d\\\"https://ci5.googleusercontent.com/proxy/TR5PyIG9osAhWRrBb5nY6obGYX_t__6T0OrzV0HLm6vzjq9xLRgs9nx_xOAlopbx-90RHpu9W1ZXobMk0ugPS_K7vhdsMG7K5rly90ry0TURp5om3PYHlnV2TErfr8Gvo0tldrOBY5-t5YvtLe5PHo91T7M7qiOLEj8i0c54ccAugfDLJwp3d3WFwUKCsQg\\u003ds0-d-e1-ft#https://dofdemfeqkgc0.cloudfront.net/account/c48fad78-de6e-4022-8914-f656c4b57d75/image/98e14405-9293-4e29-9224-ca7f0b014560\\\" style\\u003d\\\"border-radius:8px\\\" width\\u003d\\\"495\\\"\\u003e\\u003c/a\\u003e\\u003c/strong\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-568941643611869968829674198-52ce-47a1-b0fa-c9db242b98d2\\\" style\\u003d\\\"font-size:16px\\\"\\u003eInternship salaries follow a trimodal distribution, falling into 3 groups depending on the type of company you work for. Read about which companies and locations pay the most among each category on our post \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/f0193e20-f78e-4135-9be1-bc66d452779b/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/f0193e20-f78e-4135-9be1-bc66d452779b/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw3m8lxR0gibsXAaPQJVlvOK\\\"\\u003ehere\\u003c/a\\u003e.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp style\\u003d\\\"font-size:16px\\\"\\u003eExplore internship salaries on our \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/47885e00-bfaa-46ba-a53f-77408db6f49e/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/47885e00-bfaa-46ba-a53f-77408db6f49e/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw1rgRx-BxfQ9WbtOG8POTzt\\\"\\u003einternship page here\\u003c/a\\u003e.\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-568941643611869968857c5167a-00a8-4f76-add2-b38b1419ac3f\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-5689416436118699688377a89ea-2173-4bfd-8760-50 www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/45c8fc79-9402-432d-bbb1-bbdd9a2555dc/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947825000\\u0026amp;usg\\u003dAOvVaw0UwD0qYyVZ_J_e9Vl6Izqu\\\"\\u003eGoogle to use in-office attendance in performance reviews\\u003c/a\\u003e\\u003c/li\\u003e\\r\\n\\u003c/ul\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688f1da3245-af0d-4683-9ffa-4c307e34a57d\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-568941643611869968857510d5d-3b40-408e-ae2e-65d725df603a\\\" style\\u003d\\\"font-size:24px\\\"\\u003eResume Tips 📄\\u003c/h2\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996885042a567-fc78-4081-a8a0-41e165b535e7\\\" style\\u003d\\\"font-size:16px\\\"\\u003eHaving trouble getting interviews? Consider these tips from our coaches: \\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996881983c837-e9d1-4368-800a-516326e47c44\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eSummary Section: \\u003c/strong\\u003eIf you have a wealth of experience or a unique background, then a summary section might be a good choice for you! Keep it short to a few sentences and explain your background, achievements, and your goals. \\u003c/p\\u003e\\r\\n\\u003cdiv\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-568941643611869968806aec4d0-67b8-4240-ad28-39e9a8853a38\\\" style\\u003d\\\"font-size:16px\\\"\\u003e💡 Tip: You can edit this section depending on the job you’re applying to as well! If you’re aiming for a people-manager role, make the summary section more specific to that vs. an IC role.\\u003c/p\\u003e\\r\\n\\u003c/div\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688c41832ab-7611-4478-bace-73465825eaa2\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eResponsibilities vs. Achievements: \\u003c/strong\\u003eThe best thing you can do for your professional experience section is to consider your achievements vs. your responsibilities. Recruiters and Hiring Managers like to know what you’ve achieved in your jobs, how you did so, and what the results were. They’re less interested in knowing what your responsibilities were. \\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688f48851e7-deed-4b86-8150-224233a384fe\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\u003cstrong\\u003eTailored Resumes: \\u003c/strong\\u003eTailor your resume to the job you’re applying for. If the job description lists certain responsibilities, qualifications, and/or skills, make sure you showcase those in your resume as well. For example, if the job requires strong C# knowledge, then you’ll want to showcase your C# achievements in your resume!\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-5689416436118699688ffe4d226-4ac4-4602-aa99-90db3c357e95\\\" style\\u003d\\\"font-size:16px\\\"\\u003eWant 1:1 help with your resume or just a second set of eyes? Be sure to check out our \\u003ca href\\u003d\\\"https://email.levels.fyi/t/c/733927b0-bd45-4a14-834f-2c1023421a81/0187a011-53ad-7983-c12f-00f0441f349c\\\" target\\u003d\\\"_blank\\\" data-saferedirecturl\\u003d\\\"https://www.google.com/url?q\\u003dhttps://email.levels.fyi/t/c/733927b0-bd45-4a14-834f-2c1023421a81/0187a011-53ad-7983-c12f-00f0441f349c\\u0026amp;source\\u003dgmail\\u0026amp;ust\\u003d1687554947826000\\u0026amp;usg\\u003dAOvVaw1BwStoiOeq94C9JaOD2LM6\\\"\\u003eresume review and coaching service\\u003c/a\\u003e. \\u003c/p\\u003e\\r\\n\\r\\n\\u003cp id\\u003d\\\"m_-56894164361186996882529f407-a00c-441e-a2a8-eeb639ca2647\\\" style\\u003d\\\"font-size:16px\\\"\\u003e\\r\\n\\u003cbr\\u003e\\r\\n\\u003c/p\\u003e\\r\\n\\r\\n\\u003ch2 id\\u003d\\\"m_-5689416436118699688d0531b94-3e37-4b8e-857c-4c134a27133c\\\" style\\u003d\\\"font-size:24px\\\"\\u003eHelpful Resources \\u003cstrong\\u003e📎\\u003c/strong\\u003e\\u003c/h2\\u003e\\r\\n\\r\\n\\u003cp id\\u003
